class Solution{
  public:		
	int lps(string s) {
	    // Your code goes here
	    int n=s.length();
	    int i=0;
	    int j=1;
	    vector<int> ans(n,0);
	    while(j<n)
	    {
	        if(s[i]==s[j])
	        {
	            ans[j]=i+1;
	            i++;
	            j++;
	        }
	        else
	        {
	            if(i!=0)
	            {
	                i=ans[i-1];
	            }
	            else
	            {
	                j++;
	            }
	        }
	    }
	    return ans.back();
	}
};

