#include <iostream>

using namespace std;

// Struktur untuk data buah
struct Buah {
    string nama;
    int harga;
    Buah* next;
    Buah* prev;

    Buah(string _nama, int _harga) : nama(_nama), harga(_harga), next(nullptr), prev(nullptr) {}
};

Buah* head = nullptr;
Buah* tail = nullptr;

// Fungsi untuk memasukkan buah dari depan
void inputBuahDepan(string nama, int harga) {
    Buah* buahBaru = new Buah(nama, harga);
    if (head == nullptr) {
        head = buahBaru;
        tail = buahBaru;
    } else {
        buahBaru->next = head;
        head->prev = buahBaru;
        head = buahBaru;
    }
}

// Fungsi untuk memasukkan buah dari belakang
void inputBuahBelakang(string nama, int harga) {
    Buah* buahBaru = new Buah(nama, harga);
    if (tail == nullptr) {
        head = buahBaru;
        tail = buahBaru;
    } else {
        buahBaru->prev = tail;
        tail->next = buahBaru;
        tail = buahBaru;
    }
}

// Fungsi untuk mencetak buah dari depan
void cetakBuahDepan() {
    if (head == nullptr) {
        cout <<""<<endl;
        cout << "List buah masih kosong" << endl;
        return;
    }

    Buah* current = head;
    cout <<"======================================"<<endl;
    cout <<"Daftar Buah"<<endl;
    cout <<"======================================"<<endl;
    while (current != nullptr) {
        cout << "Nama: " << current->nama << ", Harga: " << current->harga << endl;
        current = current->next;
    }
}

// Fungsi untuk mencetak buah dari belakang
void cetakBuahBelakang() {
    if (tail == nullptr) {
        cout <<""<<endl;
        cout << "List buah masih kosong" << endl;
        return;
    }

    Buah* current = tail;
    cout <<"======================================"<<endl;
    cout <<"Daftar Buah"<<endl;
    cout <<"======================================"<<endl;
    while (current != nullptr) {
        cout << "Nama: " << current->nama << ", Harga: " << current->harga << endl;
        current = current->prev;
    }
}

// Fungsi untuk menghapus buah dari depan
void hapusBuahDepan() {
    if (head != nullptr) {
        Buah* buahHapus = head;
        head = head->next;
        if (head != nullptr) {
            head->prev = nullptr;
        } else {
            tail = nullptr;
        }
        delete buahHapus;
    } else {
        cout << "List buah kosong" << endl;
    }
}

// Fungsi untuk menghapus buah dari belakang
void hapusBuahBelakang() {
    if (tail != nullptr) {
        Buah* buahHapus = tail;
        tail = tail->prev;
        if (tail != nullptr) {
            tail->next = nullptr;
        } else {
            head = nullptr;
        }
        delete buahHapus;
    } else {
        cout << "List buah kosong" << endl;
    }
}

int main() {
    while (true) {
        cout <<"======================================"<<endl;
        cout << "Menu Utama:" << endl;
        cout <<"======================================"<<endl;
        cout << "1. Input Buah (Depan)" << endl;
        cout << "2. Input Buah (Belakang)" << endl;
        cout << "3. Cetak Buah (Depan)" << endl;
        cout << "4. Cetak Buah (Belakang)" << endl;
        cout << "5. Hapus (Depan)" << endl;
        cout << "6. Hapus (Belakang)" << endl;
        cout << "7. Keluar" << endl;
        cout <<""<<endl;
        cout << "Pilih menu (1-7): ";
        
        int pilihan;
        cin >> pilihan;

        switch (pilihan) {
            case 1:
                {
                    string nama;
                    int harga;
                    cout << "Masukkan nama buah: ";
                    cin >> nama;
                    cout << "Masukkan harga buah: ";
                    cin >> harga;
                    inputBuahDepan(nama, harga);
                    break;
                }
            case 2:
                {
                    string nama;
                    int harga;
                    cout << "Masukkan nama buah: ";
                    cin >> nama;
                    cout << "Masukkan harga buah: ";
                    cin >> harga;
                    inputBuahBelakang(nama, harga);
                    break;
                }
            case 3:
                cetakBuahDepan();
                break;
            case 4:
                cetakBuahBelakang();
                break;
            case 5:
                hapusBuahDepan();
                break;
            case 6:
                hapusBuahBelakang();
                break;
            case 7:
                return 0;
            default:
                cout << "Pilihan tidak valid. Silakan coba lagi." << endl;
        }

        cout << endl;
    }

    return 0;
}

class LandscapeLoginView extends StatefulWidget {
  const LandscapeLoginView({super.key});

  @override
  State<LandscapeLoginView> createState() => _LandscapeLoginViewState();
}

class _LandscapeLoginViewState extends State<LandscapeLoginView> {
  final usernameController = TextEditingController();
  final passwordController = TextEditingController();

  final username = Auth.username;
  final password = Auth.password;

  @override
  void dispose() {
    usernameController.dispose();
    passwordController.dispose();
    super.dispose();
  }

  void failedLogin() {
    ScaffoldMessenger.of(context).showSnackBar(
      const SnackBar(
        content: Text(
            'Maaf, Anda gagal masuk ke myPati. Cek kembali nama pengguna dan password Anda'),
      ),
    );
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: SafeArea(
        child: Row(
          mainAxisAlignment: MainAxisAlignment.spaceAround,
          children: [
            const Expanded(
              flex: 1,
              child: Column(
                crossAxisAlignment: CrossAxisAlignment.start,
                children: [
                  Text(
                    'Selamat datang',
                    style: TextStyle(
                      fontSize: 32,
                      fontWeight: FontWeight.w700,
                      fontFamily: 'Montserrat',
                      color: Colors.blue,
                    ),
                  ),
                  Text(
                    'di myPati',
                    style: TextStyle(
                      fontSize: 32,
                      fontWeight: FontWeight.w700,
                      fontFamily: 'Montserrat',
                      color: Colors.green,
                    ),
                  ),
                  SizedBox(height: 20), // Spasi tambahan
                  Text(
                    'Silahkan Masuk',
                    style: TextStyle(fontSize: 24),
                    textAlign: TextAlign.center,
                  ),
                ],
              ),
            ),
            Expanded(
              flex: 1,
              child: Column(
                crossAxisAlignment: CrossAxisAlignment.end,
                children: [
                  TextField(
                    controller: usernameController,
                    decoration: const InputDecoration(
                      prefixIcon: Icon(Icons.person_2_rounded),
                      label: Text('Nama Pengguna'),
                    ),
                  ),
                  TextField(
                    controller: passwordController,
                    decoration: const InputDecoration(
                      prefixIcon: Icon(Icons.lock),
                      label: Text('Kata Sandi'),
                    ),
                    obscureText: true,
                    obscuringCharacter: '*',
                  ),
                  Align(
                    alignment: Alignment.centerRight,
                    child: TextButton(
                      onPressed: () {},
                      child: const Text(
                        'Lupa kata sandi?',
                        style: TextStyle(fontSize: 18),
                      ),
                    ),
                  ),
                ],
              ),
            ),
            Container(
              margin: const EdgeInsets.symmetric(vertical: 10),
              alignment: Alignment.center,
              child: Material(
                color: Colors.green,
                borderRadius: BorderRadius.circular(20),
                child: InkWell(
                  onTap: () {
                    setState(() {
                      if (usernameController.text == username &&
                          passwordController.text == password) {
                        Navigator.pushReplacement(context,
                            MaterialPageRoute(builder: (context) {
                          return const MainView();
                        }));
                      } else {
                        failedLogin();
                      }
                    });
                  },
                  borderRadius: BorderRadius.circular(20),
                  child: const SizedBox(
                    width: 120,
                    height: 60,
                    child: Center(
                      child: Text(
                        'Masuk',
                        style: TextStyle(color: Colors.white, fontSize: 20),
                      ),
                    ),
                  ),
                ),
              ),
            ),
            const Expanded(
              flex: 1,
              child: SizedBox(),
            ),
          ],
        ),
      ),
    );
  }
}

public class Portal : MonoBehaviour, IPlayerTriggerable
{
    [SerializeField] int sceneToLoad = -1;
    [SerializeField] DesID destinationPortal;
    [SerializeField] Transform spawnPoint;

    PlayerController player;

    Fader fader;
    public void OnPlayerTriggered(PlayerController player)
    {
        player.Charecter.Animator.IsMoving = false;
        this.player = player;
        StartCoroutine(SwitchScene());
    }

    private void Start()
    {
      fader =  FindObjectOfType<Fader>();
    }
    IEnumerator SwitchScene()
    {
        DontDestroyOnLoad(gameObject);

         GameController.Instance.PauseGame(true);
        yield return fader.FadeIn(0.5f);

        yield return SceneManager.LoadSceneAsync(sceneToLoad);

        var portal = FindObjectsOfType<Portal>().First(x => x != this && x.destinationPortal == this.destinationPortal);
        //player.Charecter.SetPosToTile(portal.spawnPoint.position);

        yield return fader.FadeOut(0.5f);

        GameController.Instance.PauseGame(false);

        Destroy(gameObject);
    }

    public void OnCompanionTriggered(CompanionController companion)
    {
        throw new System.NotImplementedException();
    }

    public Transform SpawnPoint => spawnPoint;

    public bool triggerRepeatedly => false;
}

