int product_even(int size, int arr[]) {
	int prod = 1;
	int start = 0; 
	int finish = 0;

	for (int k = 0; k < size; k++) {
		if (arr[k] < 0) {
			start = k;
			break;
		}
	}

	for (int k = size - 1; k >= 0; k--) {
		if (arr[k] < 0) {
			finish = k;
			break;
		}
	}

	if (finish <= start) {
		cout << "All are positive or only one negative, may be...\n";
		return 0;
	}
	
	for (int k = start; k <= finish; k++) {
		if ((arr[k] % 2 == 0) && (arr[k] != 0)) {
			prod *= arr[k];
		}
	}

	cout << start << " " << finish << endl;
	return prod;
}

